export class User {
  constructor(email, id, _token, _tokenExpirationDate) {
    this.email = email;
    this.id = id;
    this._token = _token;
    this._tokenExpirationDate = _tokenExpirationDate;
  }
  get token() {
    if (!this._tokenExpirationDate || new Date() > this._tokenExpirationDate) {
      return "";
    }
    return this._token;
  }
}
